  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset represents lineaments in the
  Powder River Basin as identified in the following U.S. Geological Survey Professional
  Paper: Anna, L.O., 1986, Geologic framework of the ground water system in Jurassic
  and Cretaceous rocks on the Northern Great Plains, in parts of Montana, North Dakota,
  South Dakota, and Wyoming: U.S. Geological Survey Professional Paper 1402-B, 36
  p. A lineament is defined as a linear topographic feature of regional extent that
  is believed to reflect crustal structure (Hobbs et al., 1976, p. 267). Lineament
  features were transferred from the publication to a hard-copy base map by province
  geologist, then digitized and referenced for use in a Geographic Information System
  (GIS). Lineaments may: 1) enhance secondary reservoir permeability and 2) provide
  migration pathways in unconventional rocks.\",\n\t\"license_title\": null,\n\t\"extras\":
